import React from 'react';

const EventPage = () => {
    const events = [
        { id: 1, title: "Karnival Sukan Tradisional", date: "13 Jan 2024", location: "Stadium Minden, USM" },
        { id: 2, title: "Malam Santapan Secangkir Kasih", date: "15 Feb 2024", location: "USM Hall" },
    ];

    return (
        <div style={{ padding: '20px' }}>
            <h2>Upcoming Events</h2>
            <ul>
                {events.map(event => (
                    <li key={event.id} style={{ margin: '10px 0', padding: '10px', border: '1px solid #ddd' }}>
                        <h3>{event.title}</h3>
                        <p>Date: {event.date}</p>
                        <p>Location: {event.location}</p>
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default EventPage;
